package com.wlw.leetcode;

import java.util.Date;

public class Q76_MinimumWindowSubstring {

	public static void main(String[] args) {
		Q76_MinimumWindowSubstring test = new Q76_MinimumWindowSubstring();
		
		Date start = new Date();
		
		Object result = test.minWindow("ADOBECODEBANC","ABC");
//		Object result = test.minWindow("",
//				"");
//		
		
		Date end = new Date();
		System.out.println("time:"+ (end.getTime()-start.getTime()));
		System.out.println(result);
		System.out.println("time2:"+ time);
	}
	private static long time=0;
	public String minWindow(String s, String t) {
		int resultStart = -99999;
		int resultEnd = 0;
		
		int start = 0,end=0;
		boolean isSuc = false;
		while(end < s.length())	{
			Date startTime = new Date();
			if(contains(s.substring(start, end+1),t))	{
				isSuc = true;
			} else {
				isSuc = false;
			}
			Date endTime = new Date();
			time = time+ (endTime.getTime()-startTime.getTime());
			
			if(isSuc)	{
				if(end-start < resultEnd-resultStart)	{
					resultEnd = end;
					resultStart = start;
				}
				start++;
			} else {
				end++;
			}
		}
		if(resultStart+resultEnd>=0)	{
			return s.substring(resultStart, resultEnd+1);
		}
        return "";
    }
	
	public boolean contains(String A, String B) {
		
		if(A.length()<B.length())	{
			return false;
		}
		int[] array = new int[60];
		for (int i = 0; i < A.length(); i++) {
			array[A.charAt(i) - 'A'] += 1;
		}
		for (int j = 0; j < B.length(); j++) {
			array[B.charAt(j) - 'A'] -= 1;
			if(array[B.charAt(j) - 'A'] < 0) return false;
		}
		return true;
	}
}

